The v2 api expects an object to be returned from the result variable. { "version": "v2" // The version of the schema being returned from the function. This is always "v2". "empty": true|false, // Should the webhook be ignored and no output returned. The default is false (plain must be provided). "plain": "Some text", // The plaintext value to be used for the Matrix message. "html": "<b>Some</b> text", // The HTML value to be used for the Matrix message. If not provided, plain will be interpreted as markdown. "msgtype": "some.type", // The message type, such as m.notice or m.text, to be used for the Matrix message. If not provided, m.notice will be used. "webhookResponse": { // Optional response to send to the webhook requestor. All fields are optional. Defaults listed. "body": "{ \"ok\": true }", "contentType": "application/json", "statusCode": 200 }
} Example script Where data = {"counter": 5, "maxValue": 4} if (data.counter === undefined) { // The API didn't give us a counter, send no message. result = {empty: true, version: "v2"};
} else if (data.counter > data.maxValue) { result = {plain: `**Oh no!** The counter has gone over by ${data.counter - data.maxValue}`, version: "v2"};
} else { result = {plain: `*Everything is fine*, the counter is under by ${data.maxValue - data.counter}`, version: "v2"};
}

